import intro from '../ui/intro.png';

const Styledimg = styled.img`
 text-align:center;
`;


function Iimg() {
  return (
    <Styledimg>
      <img src={intro} alt="Introimg"/>
      </Styledimg>
  );
}

export default Iimg;
